  # Part 1: Find the actor of Lepacious Bose's film
  OPTIONAL {
    <http://dbpedia.org/resource/Lepacious_Bose> <http://dbpedia.org/ontology/film> ?film .
    ?film <http://dbpedia.org/ontology/starring> ?actor .
  }

  # Part 2: Find person born in the same year as Deanne Bray
  OPTIONAL {
    <http://dbpedia.org/resource/Deanne_Bray> <http://dbpedia.org/property/birthYear> ?birthYear .
    ?person <http://dbpedia.org/ontology/birthDate> ?date .
    FILTER (YEAR(?date) = ?birthYear)
    BIND(?person AS ?personBornInSameYear)
  }
}
```

