  # Part 6: Child of Alexandrine of Mecklenburg-Schwerin
  OPTIONAL {
    ?alexandrineChild <http://dbpedia.org/ontology/birthParent> <http://dbpedia.org/resource/Alexandrine_of_Mecklenburg-Schwerin> .
