  # Step 1: Find the parent of Prince Friedrich of Hesse and by Rhine
  ?parent <http://dbpedia.org/ontology/spouse> <http://dbpedia.org/resource/Prince_Friedrich_of_Hesse_and_by_Rhine> .

  # Step 2: Get the predecessor of this parent
  OPTIONAL { ?predecessor <http://dbpedia.org/ontology/successor> ?parent . }

  # Step 3: Find children of Louis I, Grand Duke of Hesse who are royalty
  ?child <http://dbpedia.org/ontology/birthParent> <http://dbpedia.org/resource/Louis_I,_Grand_Duke_of_Hesse> .
