```sparql
SELECT ?personBornAsAyoMakun ?personBornInSameYear AS ?person WHERE {
  # Find person with birth name Ayo Makun
  ?person <http://dbpedia.org/ontology/birthName> "Ayo Makun" .

  # Get Deanne Bray's birth year
  OPTIONAL { 
    ?deanneBray <http://dbpedia.org/property/birthYear> ?birthYearDeanneBray .
    FILTER(?deanneBray = <http://dbpedia.org/resource/Deanne_Bray>)
  }

  # Find persons born in the same year as Deanne Bray
  OPTIONAL {
    ?person2 <http://dbpedia.org/property/birthYear> ?birthYearDeanneBray .
    FILTER(?person != ?person2)
  }

  BIND(IF(BOUND(?person), ?person, NULL) AS ?personBornAsAyoMakun)
  BIND(IF(BOUND(?person2), ?person2, NULL) AS ?personBornInSameYear)
}
```

